//fix browser modal error
Modal.setAppElement('#root')

function App() {

  // const auth=authentication.authentication
  // console.log(`Status Before: ${auth.getLoginStatus()}`)
  // auth.doLogin()
  // console.log(`Status After: ${auth.isLoggedin}`)
  // const logInState=auth.state.isLoggedIn
  // auth.setAuth()
  // console.log(auth.state.isLoggedIn)

  const [isLoggedIn, setisLoggedIn] = useState(Auth.isLoggedIn)
  // eslint-disable-next-line react-hooks/rules-of-hooks
useEffect(()=>{},)

  function checkLogin() {
    if (isLoggedIn === false) {
      return <div>404 Page Not Found </div>
    } else {
      return <DashboardUser />
    }
  }




  return (
    <>

      <Router>
        {/*<Navbar />*/}
        <Switch>
          <Route exact path='/' component={Home} />
          <Route exact path='/about' component={About} />
          <Route exact path='/services' component={Services} />
          <Route exact path='/register' component={Register} />
          <Route exact path='/login' component={Login} />
          {/* <Route exact path='/dashboardUser' component={DashboardUser} />
          <Route exact path='/dashboardManager' component={DashboardManager} />
          <Route exact path='/dashboardCon' component={DashboardCon} /> */}
          {/* <Route exact path='/dashboardUser' component={isLoggedIn === false ? () => <div>404 Page Not Found </div> : () => <DashboardUser />} /> */}
          <Route exact path='/dashboardUser' component={checkLogin} />
          {/* <Route exact path='/dashboardUser' component={DashboardUser} /> */}
          <Route exact path='/dashboardManager' component={DashboardManager} />
          <Route exact path='/dashboardCon' component={DashboardCon} />
          <Redirect to="/" />
        </Switch>
      </Router>
    </>
  );
}

export default App;


